import React from 'react'

function Scoreboard(props) {

    const { currentScore, highScore } = props;
    return (
        <div className='scoreboard'>
            <h3>Scoreboard</h3>
            <p>Current Score: {currentScore}</p>
            <p>High Score: {highScore}</p>
        </div>
    )
}

export default Scoreboard
